/**
 * Extrae el nombre de la calle y el n√∫mero exterior de una direcci√≥n.
 * 
 * @param {string} direccion - La direcci√≥n completa en formato "Nombre de la calle N√∫meroExterior"
 * @returns {{ calle: string, next: string }} Un objeto con la calle y el n√∫mero exterior separado
 */
export const extraerCalleYNumero = (direccion) => {
  // Elimina espacios al inicio y final, y divide la direcci√≥n por espacios en un array
  const partes = direccion.trim().split(" ");

  // Se asume que la √∫ltima palabra es el n√∫mero exterior
  let next = partes.pop();

  // Verifica si la √∫ltima palabra NO es un n√∫mero, pero la pen√∫ltima S√ç lo es
  // Ejemplo: "Av. Insurgentes 123-A"
  if (isNaN(next) && partes.length > 0 && !isNaN(partes[partes.length - 1])) {
      // Combina ambas partes como n√∫mero exterior: "123 A"
      next = `${partes.pop()} ${next}`;
  }

  // Lo que queda se considera como el nombre de la calle
  const calle = partes.join(" ");

  // Devuelve un objeto con la calle y el n√∫mero exterior separados
  return { calle: calle, next: next };
};


// Ejemplos de uso:

extraerCalleYNumero("Av. Reforma 245") 
// -> { calle: "Av. Reforma", next: "245" }

extraerCalleYNumero("Calle 5 de Mayo 123-B")
// -> { calle: "Calle 5 de Mayo", next: "123-B" }

def word_counter(text):
    word_count = {}
    textwords = text.lower().split()
    for word in textwords:
        word = "".join(char for char in word if char.isalpha())
        if word.isalpha():
            if word in word_count:
                word_count[word] += 1
            else:
                word_count[word] = 1
        else:
            try:
                raise ValueError("Input must be only string!")
            except ValueError:
                print("Everything is fine.")
    return word_count
