typedef struct node {
    int value;
    struct node *next;
} node;

void print_list(node *head) {
    while (head != NULL) {
        printf("%d -> ", head->value);
        head = head->next;
    }
    printf("NULL\n");
}

node *insert_head(node *head, int val) {
    node *new = malloc(sizeof(node));
    new->next = head;
    new->value = val;
    return new;
}

void in_order_insert(node **head, int val) {
    node *new = malloc(sizeof(node));
    node **curr = head;
    node **prev = NULL;

    while (*curr && val > (*curr)->value) {
        prev = curr;
        curr = &((*curr)->next);
    }

    (*prev)->next = new;
    new->next = *curr;
}

