void append(node **head, int val) {
    node *new = malloc(sizeof(node)), **it;
    new->next = NULL;
    new->value = val;

    for (it = head; *it; it = &(*it)->next);
    *it = new;
}

void reverse(node **head) {
    node *prev = NULL;
    node *curr = *head;
    node *next;

    while (curr != NULL) {
        next = curr->next;
        curr->next = prev;
        prev = curr;
        curr = next; 
    }

    *head = prev;
}

node *find(node *list, int key) {
    while (list && list->value != key)
        list = list->next;
    return list;
}

node *delete_list(node *list, node *target) {
    if (list == target) {
        return list->next;
    }

    node *prev = NULL;

    while (list != target) {
        prev = list;
        list = list->next;
    }

    prev->next = list->next;
    free(list);

    return list;
}

void free_list(node *list) {
    node *next;

    while (list != NULL) {
        printf("deleting: %d\n", list->value);
        next = list->next;
        free(list);
        list = next;
    }
}

int main() {
    node *list = NULL;

    append(&list, 99);
    list = insert_head(list, 10);
    list = insert_head(list, 20);
    print_list(list);

    reverse(&list);

    list = delete_list(list, find(list, 99));

    in_order_insert(&list, 15);

    print_list(list);

    free_list(list);

    return 0;
}

