    cin >> n;
    vector<int> fence(n);
    for(int i = 0; i < n; i++){
        cin >> fence[i];
    }
    long long minStrokes = INT_MAX;
    getMinimumStrokes(0, 0, minStrokes, fence);
    cout << minStrokes << '\n';
}

